          href={process.env.PUBLIC_URL + "/assets/files/Resume.pdf"}
          target="_self"
          rel="noopener noreferrer"
        >
          My Resume
        </a>
      </header> */}
      <BrowserRouter>
        <div>
          <Routers>
            <Route exact path='/' component={HomePage} />
            <Route path='/about' component={AboutPage} />
            <Route component={Error} />
          </Routers>
        </div>
      </BrowserRouter>
    </div>
  );
}

export default App;

// To serve from public
